import { Accordion, AccordionSummary } from "@material-ui/core";
import { FaBeer } from 'react-icons/fa';
function Flight() {
  return (
    <div className="wrapper">
      <h3>Kết quả tìm kiếm</h3>
      <Accordion>
        <AccordionSummary
          // expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1bh-content"
          id="panel1bh-header"
        >
          <div className="info">
            <div className="name">
              <img
                src="https://static.wixstatic.com/media/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg/v1/fill/w_1000,h_626,al_c,q_90,usm_0.66_1.00_0.01/9d8ed5_a3d60d721cfc4d0fac1d5b4919d1e035~mv2.jpg"
                width="8%"
                alt="logo-brand"
              />
              <br />
              <span>VU780</span>
            </div>
            <div className="time">
              <span>07:35 <IoAirplaneSharp/> 09:10 </span>
            </div>
          </div>
          <div className="price"></div>
        </AccordionSummary>
      </Accordion>
    </div>
  );
}

export default Flight;
